            // If we're still running an old search, abort it
            if (lastXhr) {
                AJS.debug("Aborting older search");
                lastXhr.abort();
            }

            const url = getUrl(val);
            if (!url) {
                // If no url, default items may be displayed - run the callback with no data.
                callback([], val);
                return;
            }

            // TODO - should we cache on this single control or for the whole editor session? dT
            // Also, should we cache just the response JSON or the processed matrix?
            var cacheManager = autoCompleteControl.settings.cacheManager;
            var cachedData = cacheManager.get(val);
            if (cachedData) {
                loadData(cachedData, val, callback);
                return;
            }

